import "../../../../scss/utils/_all.scss";
import "../../../../scss/app/_sidePanel.scss";


import React, { Component } from 'react'

export default class SidePanel extends Component {
    render() {
        return (
            <div>
                    <div className="sidePanelWrap col-lg-2">
                        <ul>
                            <li>Pulpit</li>
                            <li>Przepisy</li>
                            <li>Plany</li>
                        </ul>
                    </div>
            </div>
        )
    }
}
